import MenuIcon from '@mui/icons-material/Menu';
import { IconButton } from "@mui/material";
import { useContext } from 'react';
import { SideBarContext } from '../State/Store/SideBarContext/SideBarContext';
import { useNavigate } from 'react-router-dom';

export default function AdminNavbar(){
  const { handleOpenSideBar } = useContext(SideBarContext);
  const navigate = useNavigate();

  return (
    <div className="sticky top-[0] w-full z-50 h-[80px] px-5 py-[.8rem] bg-[#e91e63]  lg:px-20 flex justify-between">
      <div className="flex items-center space-x-4">
        <div className='logo flex justify-between  items-center font-semibold text-grey-300 text-2xl'>
          <IconButton onClick={handleOpenSideBar}>
            <MenuIcon />
          </IconButton>
          <div onClick={()=>navigate("/")}>
            CraveKart
          </div>
        </div>

        <div>
          <div>
            <IconButton/>
          </div>
        </div>
      </div>
    </div>
  );
};
